import Diagram from "../Diagrams/Diagram";

const EventsDiagram = (props) => {

    // const diagramDataSets = [
    //     {label: 'Jan', value: 0},
    //     {label: 'Feb', value: 0},
    //     {label: 'Mar', value: 0},
    //     {label: 'Apr', value: 0},
    //     {label: 'May', value: 0},
    //     {label: 'Jun', value: 0},
    //     {label: 'Jul', value: 0},
    //     {label: 'Aug', value: 0},
    //     {label: 'Sep', value: 0},
    //     {label: 'Oct', value: 0},
    //     {label: 'Nov', value: 0},
    //     {label: 'Dec', value: 0},
    // ]
    const diagramDataSets = [
        {label: '1', value: 0},
        {label: '2', value: 0},
        {label: '3', value: 0},
        {label: '4', value: 0},
        {label: '5', value: 0},
        {label: '6', value: 0},
        {label: '7', value: 0},
        {label: '8', value: 0},
        {label: '9', value: 0},
        {label: '10', value: 0},
        {label: '11', value: 0},
        {label: '12', value: 0},
    ]

    for (const event of props.events) {
        const eventDay = event.date.toLocaleString("ru-RU", 
        {day: "2-digit"});
        if (event.mail !== null) {
            diagramDataSets[eventDay].value += 1;
        }
    }

    return <Diagram dataSets={diagramDataSets}/>
}

export default EventsDiagram;
